import Calculator from './components/Counter';
import { Provider } from 'react-redux'
import { store } from './store';
import Header from './components/Header';
import Auth from './components'


function App() {
  return (
    <Provider store={store}>
      <Header/>
      <Calculator />
      <Auth/>
    </Provider>
  );
}

export default App;
